Event.create(:id => 10004, :priority_id => 10001, :event_date => Sun, 18 Mar 2012 16:17:06 UTC +00:00, :description => "Hechos sucedidos el 18 de Marzo de 2012, en el Ejido Bustillos, municipio de Cuauhtémoc; cuando la víctima y otras niñas estaban jugando en la calle y en un domicilio cercano estaba el imputado ingiriendo bebidas embriagantes.\r\nMomentos después el sujeto le habló a la víctima y le dijo que le iba a dar dulces, así que ella se acercó, entonces el imputado le tapó la boca para evitar que gritara y en tanto tocarle sus partes íntimas; cuando la pequeña pudo liberarse corrió a su casa.", :suburb => "Ejido bustillos", :locality => "Cuauhtemoc", :observations => "Después la madre de la víctima acudió a la Fiscalía de la Mujer a denunciar los hechos, en la que se agregaron los antecedentes de la indagatoria, misma que una vez concluida solicitó al Juez de Garantías del Distrito Judicial Benito Juárez la orden de aprehensión, que fue girada el 8 de Septiembre y cumplimentada el día 10 del mismo mes, para ponerlo a disposición del Juez que lo requería.", :source => "http://tiempo.com.mx/_notas/1554000", :area_id => 10003, :crime_id => 17, :township_id => 19, :place_id => 19, :status_id => 10020, :analyst_id => 3)
Event.create(:id => 10005, :priority_id => 10000, :event_date => Wed, 11 Sep 2013 17:06:57 UTC +00:00, :description => "CTM, fue levantada una fémina, al parecer hermana de un agente de Vialidad, por un comando \r\narmado que se la llevó con todo y camioneta cuando iba llegando a la casa. \r\nTambién se llevaron un automóvil y una caja fuerte.\r\n\r\n", :street => "América Latina y Portuga", :interior_number => "2154", :suburb => "CTM", :locality => "Chihuahua", :observations => "l aviso de este hecho a las autoridades generó una fuerte movilización por parte de elementos de Seguridad Pública Municipal, l\r\na Policía Estatal Única y la Policía Ministerial quienes se encargaron de entrevistar a los testigos \r\n\r\n", :source => "http://www.laparadadigital.com/noticias-de-chihuahua-mexico.cfm?n=24621#axzz2ed41Uhxm", :area_id => 10000, :crime_id => 10, :township_id => 14, :place_id => 19, :status_id => 10020, :analyst_id => 13)
